import React from 'react';
import '../index';

const Card = ({ todoList }) => {
    return (
        <div id="card-wrap">
            <ul>
            {todoList.map((todo) => {
                return <li id={todo.todo_id} key={todo.todo_id}>{todo.todo_title}<button >Delete Todo</button></li>
            })}
            </ul>
        </div>
    )
}

export default Card;
